INSERT INTO `MAQUETTE_module` VALUES (12,'INFO501','Numération et Algorithmique',3.0,1,5,10.5,10.5,NULL,16,NULL,NULL,14,1,'- Est-il envisageable de programmer des séances de td (au moins 2) sur machine ?\r\n(ces séances se passeraient en salle de TP, avec 2 étudiants par machine)\r\n\r\n- Est-il possible de grouper les séances de TP n°2, 3 et 4 soit toutes les 3 avant Noël, soit toutes les 3 après Noël.\r\nEn effet, ces séances correspondent à un seul sujet de tp, et quand il y a la coupure de Noël, cela ne facilite pas les choses.\r\n\r\n* Enchainement C/TD/TP :\r\n\r\nC1\r\nC2\r\nC3\r\n    TD1\r\nC4\r\n    TD2\r\nC5\r\n    TD3\r\nC6\r\n    TD4\r\nC7\r\n    TD5, TD6\r\n        TP1\r\n    TD7\r\n        TP2, TP3, TP4\r\n\r\nLe CC est à placer après la fin complète du module.',0);
INSERT INTO `MAQUETTE_module` VALUES (13,'INFO502','Initiation aux BD',1.5,1,5,6,4.5,12,NULL,NULL,NULL,18,1,'CM en amphi TD en salles de TD TP en salles machines Exam pas forcément en parallèle sur les 2 sites Si possible placer tous les CM, TD et TP entre la rentrée et Toussaint et placer l\'exam après la Toussaint Regrouper, si possible, la même 1/2 journée les TD des enseignants qui ont 2 groupes. Ordre des cours : CM1 -> CM2 -> TD1 -> CM3 -> TD2 -> TD3 -> TP1 -> TP2 -> TP3 -> Exam',0);
