INSERT INTO `MRDBF_system_request` (`id_system_request`, `groupe_of_system_request`, `nom`, `request`) VALUES
(1, 'Structure', 'link_table', 'SELECT `TABLE_NAME` AS `TABLE_NAME`\r\nFROM `information_schema`.`KEY_COLUMN_USAGE`\r\nWHERE `TABLE_SCHEMA` = \'learnagement\'\r\n    AND `CONSTRAINT_NAME` = \'PRIMARY\'\r\nGROUP BY `TABLE_NAME`\r\nHAVING count(0) = 2;'),
(2, 'Structure', 'linked_table', 'SELECT DISTINCT `TABLE_NAME`\r\nFROM `information_schema`.`KEY_COLUMN_USAGE`\r\nWHERE `TABLE_SCHEMA` = \'learnagement\'\r\nAND `CONSTRAINT_NAME` LIKE \"FK%\"\r\nAND `TABLE_NAME` NOT IN\r\n(SELECT `TABLE_NAME` AS `TABLE_NAME`\r\nFROM `information_schema`.`KEY_COLUMN_USAGE`\r\nWHERE `TABLE_SCHEMA` = \'learnagement\'\r\n    AND `CONSTRAINT_NAME` = \'PRIMARY\'\r\nGROUP BY `TABLE_NAME`\r\nHAVING count(0) = 2);'),
(3, 'Structure', 'leaf_table', 'SELECT DISTINCT `TABLE_NAME` AS `TABLE_NAME`\r\nFROM `information_schema`.`KEY_COLUMN_USAGE`\r\nWHERE `TABLE_SCHEMA` = \'learnagement\'\r\nAND `TABLE_NAME` NOT IN\r\n(SELECT `TABLE_NAME`\r\nFROM `information_schema`.`KEY_COLUMN_USAGE`\r\nWHERE `TABLE_SCHEMA` = \'learnagement\'\r\nAND `CONSTRAINT_NAME` LIKE \"FK%\")'),
(4, 'Check', 'table_without_secondary_K', 'SELECT DISTINCT `TABLE_NAME`\r\nFROM `information_schema`.`KEY_COLUMN_USAGE`\r\nWHERE `TABLE_SCHEMA` = \'learnagement\'\r\nand `TABLE_NAME` not in (\r\nSELECT `TABLE_NAME` AS `TABLE_NAME`\r\nFROM `information_schema`.`KEY_COLUMN_USAGE`\r\nWHERE `TABLE_SCHEMA` = \'learnagement\'\r\n    AND `CONSTRAINT_NAME` = \'SECONDARY\');'),
(5, 'Structure', 'link', 'SELECT DISTINCT TABLE_NAME, REFERENCED_TABLE_NAME\r\nFROM `information_schema`.`KEY_COLUMN_USAGE`\r\nWHERE `TABLE_SCHEMA` = \'learnagement\'\r\nAND `CONSTRAINT_NAME` LIKE \"FK%\";'),
(6, 'Check', 'primaryK_namming_error', 'SELECT DISTINCT TABLE_NAME, COLUMN_NAME, TRIM( SUBSTR(TABLE_NAME, LOCATE(\'_\', TABLE_NAME)) ), TRIM( SUBSTR(COLUMN_NAME, LOCATE(\'_\', COLUMN_NAME)) )\r\nFROM `information_schema`.`KEY_COLUMN_USAGE`\r\nWHERE `TABLE_SCHEMA` = \'learnagement\'\r\nAND `CONSTRAINT_NAME` LIKE \"PRIMARY\"\r\nAND TABLE_NAME IN \r\n(SELECT DISTINCT TABLE_NAME\r\nFROM `information_schema`.`KEY_COLUMN_USAGE`\r\nWHERE `TABLE_SCHEMA` = \'learnagement\'\r\nAND `CONSTRAINT_NAME` LIKE \"PRIMARY\"\r\nGROUP BY TABLE_NAME\r\nHAVING COUNT(*)=1)\r\nAND TRIM( SUBSTR(TABLE_NAME, LOCATE(\'_\', TABLE_NAME)) ) != TRIM( SUBSTR(COLUMN_NAME, LOCATE(\'_\', COLUMN_NAME)) );');
INSERT INTO `VIEW_check` (`id_view`, `sortIndex`, `name`, `group_of_views`, `request`) VALUES
(12, 6, 'Erreur de séquencage', 'Check', 'SELECT \r\n    `MAQUETTE_module`.`code_module`, \r\n    IFNULL(`hCM`,0) + IFNULL(`hTD`,0) + IFNULL(`hTP`,0) + IFNULL(`hTPTD`,0) + IFNULL(`hPROJ`,0) AS `hMCCC`, \r\n    `hCequenced`, \r\n    IFNULL(`hCM`,0) + IFNULL(`hTD`,0) + IFNULL(`hTP`,0) + IFNULL(`hTPTD`,0) + IFNULL(`hPROJ`,0) - `hCequenced` AS `Reste à planifier`\r\nFROM `MAQUETTE_module`\r\nJOIN `LNM_semestre` ON `LNM_semestre`.`id_semestre` = `MAQUETTE_module`.`id_semestre`\r\n  JOIN `learnagement`.`MAQUETE_module_as_learning_unit` ON `learnagement`.`MAQUETTE_module_as_learning_unit`.`id_module` = `learnagement`.`MAQUETTE_module`.`id_module`\r\n  JOIN `learnagement`.`MAQUETTE_learning_unit` ON `learnagement`.`MAQUETTE_learning_unit`.`id_learning_unit` = `learnagement`.`MAQUETTE_module_as_learning_unit`.`id_learning_unit`\r\n  JOIN `learnagement`.`LNM_promo` ON `learnagement`.`MAQUETTE_learning_unit`.`id_promo` = `learnagement`.`LNM_promo`.`id_promo`\r\n  JOIN `learnagement`.`LNM_statut` ON `learnagement`.`LNM_statut`.`id_statut` = `learnagement`.`LNM_promo`.`id_statut`\r\n  JOIN `learnagement`.`LNM_filiere` \r\n       ON `learnagement`.`LNM_filiere`.`id_filiere` = `learnagement`.`LNM_promo`.`id_filiere`\r\n  JOIN `learnagement`.`MAQUETTE_discipline`\r\n       ON `learnagement`.`MAQUETTE_discipline`.`id_discipline` = `learnagement`.`MAQUETTE_module`.`id_discipline`\r\nJOIN (\r\n    SELECT `code_module`, SUM(`duree_h`) as hCequenced\r\n    FROM `MAQUETTE_module_sequencage` \r\n    JOIN `MAQUETTE_module_sequence` ON `MAQUETTE_module_sequence`.id_module_sequencage = `MAQUETTE_module_sequencage`.id_module_sequencage\r\n    JOIN `MAQUETTE_module` ON `MAQUETTE_module`.`id_module` = `MAQUETTE_module_sequencage`.`id_module`\r\n    GROUP BY `code_module`) sequenced ON  sequenced.`code_module` = `MAQUETTE_module`.`code_module`\r\nWHERE 1;'),
(14, 6, 'Surcharge IDU FISEA', 'Check', 'SELECT MAQUETTE_discipline.nom, sum(Module_Supp_IDU_FISEA_FISE.hCM) as hCM, sum(Module_Supp_IDU_FISEA_FISE.hTD) as hTD, 2 * sum(Module_Supp_IDU_FISEA_FISE.hTP) as hTP, sum(Module_Supp_IDU_FISEA_FISE.hTPTD) as hTPTD, ifnull(sum(Module_Supp_IDU_FISEA_FISE.hCM),0)+ifnull(sum(Module_Supp_IDU_FISEA_FISE.hTD),0)+2 * ifnull(sum(Module_Supp_IDU_FISEA_FISE.hTP),0)+ifnull(sum(Module_Supp_IDU_FISEA_FISE.hTPTD),0) as hSup\r\nfrom Module_Supp_IDU_FISEA_FISE \r\nJOIN `learnagement`.`LNM_semestre` ON `learnagement`.`LNM_semestre`.`id_semestre` = Module_Supp_IDU_FISEA_FISE.`id_semestre` \r\nJOIN `learnagement`.`MAQUETTE_discipline` ON `learnagement`.`MAQUETTE_discipline`.`id_discipline` = Module_Supp_IDU_FISEA_FISE.`id_discipline` \r\nJOIN `learnagement`.`MAQUETTE_module_as_learning_unit` ON Module_Supp_IDU_FISEA_FISE.`id_module` = `learnagement`.`MAQUETTE_module_as_learning_unit`.`id_module`\r\nJoin `learnagement`.`MAQUETTE_module` ON `learnagement`.`MAQUETTE_module`.`id_module` = `learnagement`.`MAQUETTE_module_as_learning_unit`.`id_module`\r\nJOIN `learnagement`.`MAQUETTE_learning_unit` ON `learnagement`.`MAQUETTE_module_as_learning_unit`.`id_learning_unit` = `learnagement`.`MAQUETTE_learning_unit`.`id_learning_unit` \r\nJOIN `learnagement`.`LNM_promo` ON `learnagement`.`MAQUETTE_learning_unit`.`id_promo` = `learnagement`.`LNM_promo`.`id_promo` \r\nJOIN `learnagement`.`LNM_filiere` ON `learnagement`.`LNM_filiere`.`id_filiere` = `learnagement`.`LNM_promo`.`id_filiere` \r\nJOIN `LNM_statut` ON `LNM_statut`.`id_statut` = `LNM_promo`.`id_statut` \r\nLEFT OUTER JOIN `learnagement`.`LNM_enseignant` ON Module_Supp_IDU_FISEA_FISE.`id_responsable` = `learnagement`.`LNM_enseignant`.`id_enseignant` \r\nWHERE `learnagement`.`LNM_filiere`.`nom_filiere` = \"IDU\" and `LNM_statut`.nom_statut =\"FISEA\" and 1\r\nGROUP BY MAQUETTE_discipline.nom;');
INSERT INTO `VIEW_display` (`id_view`, `sortIndex`, `name`, `group_of_views`, `request`) VALUES
(3, 40, 'resposabilite', 'Module', 'SELECT \r\n  CONCAT(`LNM_enseignant`.`prenom`,\' \',`LNM_enseignant`.`nom`) AS `responsable`,\r\n  COUNT(`MAQUETTE_module`.`id_module`) AS `responsabilite`,\r\n  GROUP_CONCAT(distinct `MAQUETTE_module`.`code_module` separator \', \') AS `modules` \r\nFROM \r\n  `LNM_enseignant` \r\n  JOIN `MAQUETTE_module` \r\n       ON `MAQUETTE_module`.`id_responsable` = `LNM_enseignant`.`id_enseignant` \r\n  \r\n  JOIN `MAQUETTE_module_as_learning_unit` ON `MAQUETTE_module_as_learning_unit`.`id_module` = `MAQUETTE_module`.`id_module`\r\n  JOIN `MAQUETTE_learning_unit` ON `MAQUETTE_learning_unit`.`id_learning_unit` = `MAQUETTE_module_as_learning_unit`.`id_learning_unit`\r\n  JOIN `LNM_promo` ON `MAQUETTE_learning_unit`.`id_promo` = `LNM_promo`.`id_promo`\r\n  JOIN `LNM_statut` ON `LNM_statut`.`id_statut` = `LNM_promo`.`id_statut`\r\n  JOIN `LNM_filiere` \r\n       ON `LNM_filiere`.`id_filiere` = `LNM_promo`.`id_filiere`\r\n  JOIN `LNM_semestre` \r\n       ON `LNM_semestre`.`id_semestre` = `MAQUETTE_module`.`id_semestre`\r\n  JOIN `MAQUETTE_discipline`\r\n       ON `MAQUETTE_discipline`.`id_discipline` = `MAQUETTE_module`.`id_discipline`\r\nWHERE 1\r\nGROUP BY `LNM_enseignant`.`nom`, `LNM_enseignant`.`prenom`;'),
(4, 40, 'MCCC par module', 'Module', 'SELECT \r\n`MAQUETTE_module`.`code_module` AS `code_module`, \r\n`MAQUETTE_module`.`nom` AS `nom`, \r\n`MAQUETTE_module`.`ECTS` AS `ECTS`, \r\ngroup_concat(`MAQUETTE_learning_unit`.`learning_unit_code` separator \', \') AS `UE`, \r\ngroup_concat(`LNM_filiere`.`nom_filiere` separator \', \') AS `filieres`, \r\n`MAQUETTE_module`.`hCM` AS `hCM`, \r\n`MAQUETTE_module`.`hTD` AS `hTD`, \r\n`MAQUETTE_module`.`hTP` AS `hTP`, \r\n`MAQUETTE_module`.`hTPTD` AS `hTPTD`, \r\nifnull(`MAQUETTE_module`.`hCM`, 0) + ifnull(`MAQUETTE_module`.`hTD`, 0) + ifnull(`MAQUETTE_module`.`hTP`, 0) + ifnull(`MAQUETTE_module`.`hTPTD`, 0) AS `hTE`,\r\nround((ifnull(`MAQUETTE_module`.`hCM`, 0) + ifnull(`MAQUETTE_module`.`hTD`, 0) + ifnull(`MAQUETTE_module`.`hTP`, 0) + ifnull(`MAQUETTE_module`.`hTPTD`, 0)) / `ECTS`, 2) AS `hTE/ECTS`,\r\nround(`ECTS` / (ifnull(`MAQUETTE_module`.`hCM`, 0) + ifnull(`MAQUETTE_module`.`hTD`, 0) + ifnull(`MAQUETTE_module`.`hTP`, 0) + ifnull(`MAQUETTE_module`.`hTPTD`, 0)), 2) AS `ECTS/hTE`,\r\n`MAQUETTE_module`.`hPROJ` AS `hPROJ`, \r\n`MAQUETTE_module`.`hPersonnelle` AS `hPersonnelle`, \r\nconcat(`LNM_enseignant`.`prenom`,\' \',`LNM_enseignant`.`nom`) AS `responsable`, \r\n`MAQUETTE_module`.`commentaire` AS `commentaire` \r\nFROM `MAQUETTE_module` \r\nJOIN `LNM_semestre` ON `LNM_semestre`.`id_semestre` = `MAQUETTE_module`.`id_semestre` \r\nJOIN `MAQUETTE_discipline` ON `MAQUETTE_discipline`.`id_discipline` = `MAQUETTE_module`.`id_discipline` \r\nJOIN `MAQUETTE_module_as_learning_unit` ON `MAQUETTE_module`.`id_module` = `MAQUETTE_module_as_learning_unit`.`id_module` \r\nJOIN `MAQUETTE_learning_unit` ON `MAQUETTE_module_as_learning_unit`.`id_learning_unit` = `MAQUETTE_learning_unit`.`id_learning_unit` \r\nJOIN `LNM_promo` ON `MAQUETTE_learning_unit`.`id_promo` = `LNM_promo`.`id_promo` \r\nJOIN `LNM_filiere` ON `LNM_filiere`.`id_filiere` = `LNM_promo`.`id_filiere` \r\nJOIN `LNM_statut` ON `LNM_statut`.`id_statut` = `LNM_promo`.`id_statut` \r\nLEFT OUTER JOIN `LNM_enseignant` ON `MAQUETTE_module`.`id_responsable` = `LNM_enseignant`.`id_enseignant` \r\nWHERE 1\r\nGROUP BY `MAQUETTE_module`.`id_module`\r\nORDER BY UE, `MAQUETTE_module`.`code_module`;'),
(5, 30, 'répartition charge CM, TD...', 'Global', 'SELECT \r\n        SUM(`MAQUETTE_module`.`hCM`) AS `hCM`,\r\n        SUM(`MAQUETTE_module`.`hTD`) AS `hTD`,\r\n        SUM(`MAQUETTE_module`.`hTP`) AS `hTP`,\r\n        SUM(`MAQUETTE_module`.`hTPTD`) AS `hTPTD`,\r\n        SUM(`MAQUETTE_module`.`hPROJ`) AS `hPROJ`,\r\n        SUM(`MAQUETTE_module`.`hPersonnelle`) AS `hPersonnelle`,\r\n      (\r\n        SUM(`MAQUETTE_module`.`hCM`) + \r\n        SUM(`MAQUETTE_module`.`hTD`) + \r\n        SUM(`MAQUETTE_module`.`hTP`) + \r\n        SUM(`MAQUETTE_module`.`hTPTD`)\r\n      ) AS `heures filière`\r\n        \r\n    FROM `MAQUETTE_module` \r\nJOIN `LNM_semestre` ON `LNM_semestre`.`id_semestre` = `MAQUETTE_module`.`id_semestre` \r\nJOIN `MAQUETTE_discipline` ON `MAQUETTE_discipline`.`id_discipline` = `MAQUETTE_module`.`id_discipline` \r\nJOIN `MAQUETTE_module_as_learning_unit` ON `MAQUETTE_module`.`id_module` = `MAQUETTE_module_as_learning_unit`.`id_module` \r\nJOIN `MAQUETTE_learning_unit` ON `MAQUETTE_module_as_learning_unit`.`id_learning_unit` = `MAQUETTE_learning_unit`.`id_learning_unit` \r\nJOIN `LNM_promo` ON `MAQUETTE_learning_unit`.`id_promo` = `LNM_promo`.`id_promo` \r\nJOIN `LNM_filiere` ON `LNM_filiere`.`id_filiere` = `LNM_promo`.`id_filiere` \r\nJOIN `LNM_statut` ON `LNM_statut`.`id_statut` = `LNM_promo`.`id_statut` \r\nLEFT OUTER JOIN `LNM_enseignant` ON `MAQUETTE_module`.`id_responsable` = `LNM_enseignant`.`id_enseignant` \r\nWHERE 1;'),
(6, 30, 'Service disciplinaire', 'Global', 'SELECT SUM(`LNM_enseignant`.`service statutaire`) AS `service statutaire`,\r\n       SUM(`LNM_enseignant`.`service effectif`) AS `service avec décharge`\r\nFROM `LNM_enseignant`\r\nWHERE `LNM_enseignant`.`statut` = \'permanent\' \r\n    AND `LNM_enseignant`.`composante` = \'polytech\';'),
(7, 40, 'Charge en responsabilité', 'Module', 'SELECT\r\n  ( IFNULL(SUM((`MAQUETTE_module`.`hCM` * 1.5) * `LNM_promo`.`nbGroupeCM`), 0)\r\n    + IFNULL(SUM(`MAQUETTE_module`.`hTD` * `LNM_promo`.`nbGroupeTD`), 0)\r\n    + IFNULL(SUM(`MAQUETTE_module`.`hTP` * `LNM_promo`.`nbGroupeTP`), 0)\r\n    + IFNULL(SUM(`MAQUETTE_module`.`hTPTD` * `LNM_promo`.`nbGroupeTD`), 0)\r\n  ) AS `Heures enseignant`, \r\n  ( IFNULL(SUM(`MAQUETTE_module`.`hCM`), 0)\r\n    + IFNULL(SUM(`MAQUETTE_module`.`hTD`), 0)\r\n    + IFNULL(SUM(`MAQUETTE_module`.`hTP`), 0)\r\n    + IFNULL(SUM(`MAQUETTE_module`.`hTPTD`), 0)\r\n  ) AS `heures étudiant` \r\nFROM `MAQUETTE_module` \r\n  JOIN `LNM_semestre`                ON `LNM_semestre`.`id_semestre` = `MAQUETTE_module`.`id_semestre` \r\n  JOIN `MAQUETTE_discipline`              ON `MAQUETTE_discipline`.`id_discipline` = `MAQUETTE_module`.`id_discipline` \r\n  JOIN `MAQUETTE_module_as_learning_unit` ON `MAQUETTE_module`.`id_module` = `MAQUETTE_module_as_learning_unit`.`id_module` \r\n  JOIN `MAQUETTE_learning_unit`           ON `MAQUETTE_module_as_learning_unit`.`id_learning_unit` = `MAQUETTE_learning_unit`.`id_learning_unit` \r\n  JOIN `LNM_promo`                   ON `MAQUETTE_learning_unit`.`id_promo` = `LNM_promo`.`id_promo` \r\n  JOIN `LNM_filiere`                 ON `LNM_filiere`.`id_filiere` = `LNM_promo`.`id_filiere` \r\n  JOIN `LNM_statut`                  ON `LNM_statut`.`id_statut` = `LNM_promo`.`id_statut` \r\n  LEFT OUTER JOIN `LNM_enseignant`   ON `MAQUETTE_module`.`id_responsable` = `LNM_enseignant`.`id_enseignant` \r\nWHERE 1;'),
(8, 40, 'répartition seance', 'Module', 'SELECT `MAQUETTE_module`.`code_module`, \r\n       `LNM_enseignant`.`prenom`, \r\n       `LNM_seanceType`.`type`, \r\n       MAQUETTE_module_sequence.`numero_ordre`, \r\n       `LNM_groupe`.`nom_groupe`\r\nFROM `MAQUETTE_module`\r\nJOIN MAQUETTE_module_sequencage  ON MAQUETTE_module_sequencage.id_module = MAQUETTE_module.id_module\r\nJOIN MAQUETTE_module_sequence ON MAQUETTE_module_sequence.id_module_sequencage = MAQUETTE_module_sequencage.id_module_sequencage\r\nJOIN CLASS_session_to_be_affected ON CLASS_session_to_be_affected.id_module_sequence = MAQUETTE_module_sequence.id_module_sequence\r\nJOIN CLASS_session_to_be_affected_as_enseignant ON CLASS_session_to_be_affected.id_seance_to_be_affected = CLASS_session_to_be_affected_as_enseignant.id_seance_to_be_affected\r\nJOIN `LNM_enseignant` ON `CLASS_session_to_be_affected_as_enseignant`.`id_enseignant` = `LNM_enseignant`.`id_enseignant`\r\nJOIN `LNM_groupe` ON `CLASS_session_to_be_affected`.`id_groupe` = `LNM_groupe`.`id_groupe` \r\nJOIN `LNM_seanceType` ON `LNM_seanceType`.`id_seance_type` = MAQUETTE_module_sequencage.`id_seance_type`\r\nJOIN `MAQUETTE_module_as_learning_unit` ON `MAQUETTE_module_as_learning_unit`.`id_module` = `MAQUETTE_module`.`id_module`\r\nJOIN `MAQUETTE_learning_unit` ON `MAQUETTE_learning_unit`.`id_learning_unit` = `MAQUETTE_module_as_learning_unit`.`id_learning_unit`\r\nJOIN `LNM_promo` ON `MAQUETTE_learning_unit`.`id_promo` = `LNM_promo`.`id_promo`\r\nJOIN `LNM_statut` ON `LNM_statut`.`id_statut` = `LNM_promo`.`id_statut`\r\nJOIN `LNM_filiere` ON `LNM_filiere`.`id_filiere` = `LNM_promo`.`id_filiere`\r\nJOIN `LNM_semestre` ON `LNM_semestre`.`id_semestre` = `MAQUETTE_module`.`id_semestre`\r\nJOIN `MAQUETTE_discipline` ON `MAQUETTE_discipline`.`id_discipline` = `MAQUETTE_module`.`id_discipline`\r\nWHERE 1\r\nORDER BY `MAQUETTE_module`.`code_module`, \r\n         `LNM_seanceType`.`type`, \r\n         MAQUETTE_module_sequence.`numero_ordre`, \r\n         `LNM_groupe`.`nom_groupe`;'),
(9, 40, 'Dépendance de séances', 'Module', 'SELECT previousModule.`code_module` as \"module précédent\", \r\n       CONCAT(previousSeanceType.`type`, \r\n       previousSequences.`numero_ordre`) as \"séance précédente\",\r\n       nextModule.`code_module` as \"module suivant\", \r\n       CONCAT(nextSeanceType.`type`, \r\n       nextSequences.`numero_ordre`) as \"séance suivante\"\r\n\r\nFROM `MAQUETTE_dependance_sequence` \r\n\r\nJOIN `MAQUETTE_module_sequence` previousSequences \r\n    ON previousSequences.`id_module_sequence` = `MAQUETTE_dependance_sequence`.`id_sequence_prev` \r\nJOIN `MAQUETTE_module_sequencage` previousSequencages \r\n    ON previousSequencages.`id_module_sequencage` = previousSequences.`id_module_sequencage`\r\nJOIN `MAQUETTE_module` previousModule \r\n    ON previousModule.`id_module` = previousSequencages.`id_module` \r\nJOIN `LNM_seanceType` previousSeanceType\r\n    ON previousSeanceType.id_seance_type = previousSequencages.`id_seance_type`\r\n\r\nJOIN `MAQUETTE_module` \r\n    ON `MAQUETTE_module`.`id_module` = previousModule.`id_module`\r\nJOIN `LNM_semestre` \r\n    ON `LNM_semestre`.`id_semestre` = `MAQUETTE_module`.`id_semestre`\r\n\r\nJOIN `MAQUETTE_module_sequence` nextSequences \r\n    ON nextSequences.`id_module_sequence` = `MAQUETTE_dependance_sequence`.`id_sequence_next`  \r\nJOIN `MAQUETTE_module_sequencage` nextSequencages \r\n    ON nextSequencages.`id_module_sequencage` = nextSequences.`id_module_sequencage`\r\nJOIN `MAQUETTE_module` nextModule \r\n    ON nextModule.`id_module` = nextSequencages.`id_module` \r\nJOIN `LNM_seanceType` nextSeanceType\r\n    ON nextSeanceType.id_seance_type = nextSequencages.`id_seance_type`\r\n\r\nJOIN `MAQUETTE_module_as_learning_unit` ON `MAQUETTE_module_as_learning_unit`.`id_module` = `MAQUETTE_module`.`id_module`\r\n  JOIN `MAQUETTE_learning_unit` ON `MAQUETTE_learning_unit`.`id_learning_unit` = `MAQUETTE_module_as_learning_unit`.`id_learning_unit`\r\n  JOIN `LNM_promo` ON `MAQUETTE_learning_unit`.`id_promo` = `LNM_promo`.`id_promo`\r\n  JOIN `LNM_statut` ON `LNM_statut`.`id_statut` = `LNM_promo`.`id_statut`\r\n  JOIN `LNM_filiere` \r\n       ON `LNM_filiere`.`id_filiere` = `LNM_promo`.`id_filiere`\r\n  JOIN `MAQUETTE_discipline`\r\n       ON `MAQUETTE_discipline`.`id_discipline` = `MAQUETTE_module`.`id_discipline`\r\nWHERE 1;'),
(11, 30, 'resposabilités globales', 'Global', 'SELECT \r\n  CONCAT(enseignant.`prenom`,\' \',enseignant.`nom`) AS `responsable`,\r\n  COUNT(module.`id_module`) AS `responsabilite`,\r\n  GROUP_CONCAT(distinct module.`code_module` separator \', \') AS `modules` \r\nFROM \r\n  `LNM_enseignant` enseignant\r\n  JOIN `MAQUETTE_module` module ON module.`id_responsable` = enseignant.`id_enseignant` \r\nWHERE 1\r\nGROUP BY enseignant.`nom`, enseignant.`prenom`'),
(13, 50, 'MCCC par UE', 'UE', 'SELECT \r\nsum(`MAQUETTE_module`.`ECTS`) AS `ECTS`, \r\n`MAQUETTE_learning_unit`.`learning_unit_code` AS `UE`, \r\n`LNM_filiere`.`nom_filiere` AS `filieres`, \r\nsum(`MAQUETTE_module`.`hCM`) AS `hCM`, \r\nsum(`MAQUETTE_module`.`hTD`) AS `hTD`, \r\nsum(`MAQUETTE_module`.`hTP`) AS `hTP`, \r\nsum(`MAQUETTE_module`.`hTPTD`) AS `hTPTD`, \r\nsum(`MAQUETTE_module`.`hPROJ`) AS `hPROJ`, \r\nsum(`MAQUETTE_module`.`hPersonnelle`) AS `hPersonnelle`,\r\nifnull(sum(`MAQUETTE_module`.`hCM`), 0) + ifnull(sum(`MAQUETTE_module`.`hTD`), 0) + ifnull(sum(`MAQUETTE_module`.`hTP`), 0) + ifnull(sum(`MAQUETTE_module`.`hTPTD`), 0) AS `hTotale`\r\nFROM `MAQUETTE_module` \r\nJOIN `LNM_semestre` ON `LNM_semestre`.`id_semestre` = `MAQUETTE_module`.`id_semestre` \r\nJOIN `MAQUETTE_discipline` ON `MAQUETTE_discipline`.`id_discipline` = `MAQUETTE_module`.`id_discipline` \r\nJOIN `MAQUETTE_module_as_learning_unit` ON `MAQUETTE_module`.`id_module` = `MAQUETTE_module_as_learning_unit`.`id_module` \r\nJOIN `MAQUETTE_learning_unit` ON `MAQUETTE_module_as_learning_unit`.`id_learning_unit` = `MAQUETTE_learning_unit`.`id_learning_unit` \r\nJOIN `LNM_promo` ON `MAQUETTE_learning_unit`.`id_promo` = `LNM_promo`.`id_promo` \r\nJOIN `LNM_filiere` ON `LNM_filiere`.`id_filiere` = `LNM_promo`.`id_filiere` \r\nJOIN `LNM_statut` ON `LNM_statut`.`id_statut` = `LNM_promo`.`id_statut` \r\nLEFT OUTER JOIN `LNM_enseignant` ON `MAQUETTE_module`.`id_responsable` = `LNM_enseignant`.`id_enseignant` \r\nWHERE 1\r\nGROUP BY `MAQUETTE_learning_unit`.`learning_unit_code`, `LNM_filiere`.`nom_filiere`;'),
(15, 50, 'MCCC par Semestre', 'Semestre', 'SELECT \r\nsum(`MAQUETTE_module`.`ECTS`) AS `ECTS`, \r\n`LNM_semestre`.`id_semestre` AS `semestre`, \r\n`LNM_filiere`.`nom_filiere` AS `filiere`, \r\nsum(`MAQUETTE_module`.`hCM`) AS `hCM`, \r\nsum(`MAQUETTE_module`.`hTD`) AS `hTD`, \r\nsum(`MAQUETTE_module`.`hTP`) AS `hTP`, \r\nsum(`MAQUETTE_module`.`hTPTD`) AS `hTPTD`, \r\nsum(`MAQUETTE_module`.`hPROJ`) AS `hPROJ`, \r\nsum(`MAQUETTE_module`.`hPersonnelle`) AS `hPersonnelle`,\r\nifnull(sum(`MAQUETTE_module`.`hCM`), 0) + ifnull(sum(`MAQUETTE_module`.`hTD`), 0) + ifnull(sum(`MAQUETTE_module`.`hTP`), 0) + ifnull(sum(`MAQUETTE_module`.`hTPTD`), 0) AS `hTotale`\r\nFROM `MAQUETTE_module` \r\nJOIN `LNM_semestre` ON `LNM_semestre`.`id_semestre` = `MAQUETTE_module`.`id_semestre` \r\nJOIN `MAQUETTE_discipline` ON `MAQUETTE_discipline`.`id_discipline` = `MAQUETTE_module`.`id_discipline` \r\nJOIN `MAQUETTE_module_as_learning_unit` ON `MAQUETTE_module`.`id_module` = `MAQUETTE_module_as_learning_unit`.`id_module` \r\nJOIN `MAQUETTE_learning_unit` ON `MAQUETTE_module_as_learning_unit`.`id_learning_unit` = `MAQUETTE_learning_unit`.`id_learning_unit` \r\nJOIN `LNM_promo` ON `MAQUETTE_learning_unit`.`id_promo` = `LNM_promo`.`id_promo` \r\nJOIN `LNM_filiere` ON `LNM_filiere`.`id_filiere` = `LNM_promo`.`id_filiere` \r\nJOIN `LNM_statut` ON `LNM_statut`.`id_statut` = `LNM_promo`.`id_statut` \r\nLEFT OUTER JOIN `LNM_enseignant` ON `MAQUETTE_module`.`id_responsable` = `LNM_enseignant`.`id_enseignant` \r\nWHERE 1\r\nGROUP BY `LNM_semestre`.`id_semestre`, `LNM_filiere`.`nom_filiere`\r\nORDER BY `LNM_semestre`.`id_semestre`;'),
(16, 10, 'ECTS / h par module', 'Check', 'SELECT \r\n`MAQUETTE_module`.`code_module` AS `code_module`, \r\n`MAQUETTE_module`.`nom` AS `nom`, \r\n`MAQUETTE_module`.`ECTS` AS `ECTS`,\r\n`MAQUETTE_module`.`hCM` AS `hCM`, \r\n`MAQUETTE_module`.`hTD` AS `hTD`, \r\n`MAQUETTE_module`.`hTP` AS `hTP`, \r\n`MAQUETTE_module`.`hTPTD` AS `hTPTD`, \r\n`MAQUETTE_module`.`hPROJ` AS `hPROJ`, \r\n`MAQUETTE_module`.`hPersonnelle` AS `hPersonnelle`, \r\n`MAQUETTE_module`.`ECTS` / (ifnull(`MAQUETTE_module`.`hCM`, 0) + ifnull(`MAQUETTE_module`.`hTD`, 0) + ifnull(`MAQUETTE_module`.`hTP`, 0) + ifnull(`MAQUETTE_module`.`hTPTD`, 0)) AS `ECTS/h`\r\nFROM `MAQUETTE_module` \r\nJOIN `LNM_semestre` ON `LNM_semestre`.`id_semestre` = `MAQUETTE_module`.`id_semestre` \r\nJOIN `MAQUETTE_discipline` ON `MAQUETTE_discipline`.`id_discipline` = `MAQUETTE_module`.`id_discipline` \r\nJOIN `MAQUETTE_module_as_learning_unit` ON `MAQUETTE_module`.`id_module` = `MAQUETTE_module_as_learning_unit`.`id_module` \r\nJOIN `MAQUETTE_learning_unit` ON `MAQUETTE_module_as_learning_unit`.`id_learning_unit` = `MAQUETTE_learning_unit`.`id_learning_unit` \r\nJOIN `LNM_promo` ON `MAQUETTE_learning_unit`.`id_promo` = `LNM_promo`.`id_promo` \r\nJOIN `LNM_filiere` ON `LNM_filiere`.`id_filiere` = `LNM_promo`.`id_filiere` \r\nJOIN `LNM_statut` ON `LNM_statut`.`id_statut` = `LNM_promo`.`id_statut` \r\nLEFT OUTER JOIN `LNM_enseignant` ON `MAQUETTE_module`.`id_responsable` = `LNM_enseignant`.`id_enseignant` \r\nWHERE 1\r\nGROUP BY `MAQUETTE_module`.`id_module`\r\nORDER BY `MAQUETTE_module`.`code_module`;'),
(17, 10, 'Seances non affectées', 'Check', 'SELECT MAQUETTE_module.code_module, MAQUETTE_module.nom, concat(LNM_enseignant.prenom, \' \', LNM_enseignant.nom) as \"responsable\", COUNT(*) as \"nombre_de_seances\", LNM_seanceType.type, LNM_groupe.nom_groupe\r\nFROM \r\nMAQUETTE_module_sequencage\r\nJOIN MAQUETTE_module_sequence ON MAQUETTE_module_sequence.id_module_sequencage = MAQUETTE_module_sequencage.id_module_sequencage\r\nJOIN `CLASS_session_to_be_affected` ON CLASS_session_to_be_affected.id_module_sequence = MAQUETTE_module_sequence.id_module_sequence\r\nJOIN `CLASS_session_to_be_affected_as_enseignant` ON `CLASS_session_to_be_affected`.`id_seance_to_be_affected` = `CLASS_session_to_be_affected_as_enseignant`.`id_seance_to_be_affected`\r\nJOIN LNM_seanceType ON LNM_seanceType.id_seance_type = MAQUETTE_module_sequencage.id_seance_type\r\nJOIN LNM_groupe on LNM_groupe.id_groupe = CLASS_session_to_be_affected.id_groupe\r\nJOIN MAQUETTE_module ON MAQUETTE_module.id_module = MAQUETTE_module_sequencage.`id_module`\r\nJOIN LNM_enseignant ON LNM_enseignant.id_enseignant = MAQUETTE_module.id_responsable\r\nWHERE `CLASS_session_to_be_affected_as_enseignant`.`id_enseignant` IS NULL\r\nGROUP BY MAQUETTE_module.code_module, MAQUETTE_module.nom, LNM_enseignant.prenom, LNM_enseignant.nom, LNM_seanceType.type, LNM_groupe.nom_groupe\r\nORDER BY `MAQUETTE_module`.`code_module` ASC;'),
(18, 20, '2 Intervention par module', 'Enseignant', 'SELECT LNM_enseignant.prenom, LNM_enseignant.nom, MAQUETTE_module.code_module, \r\nSUM(case when LNM_seanceType.type = \"CM\" THEN MAQUETTE_module_sequencage.duree_h END) AS \"CM\",\r\nSUM(case when LNM_seanceType.type = \"TD\" THEN MAQUETTE_module_sequencage.duree_h END) AS \"TD\",\r\nSUM(case when LNM_seanceType.type = \"TP\" THEN MAQUETTE_module_sequencage.duree_h END) AS \"TP\"\r\nFROM `MAQUETTE_module` \r\nJOIN MAQUETTE_module_sequencage ON MAQUETTE_module_sequencage.id_module = MAQUETTE_module.id_module\r\nJOIN MAQUETTE_module_sequence ON MAQUETTE_module_sequence.id_module_sequencage = MAQUETTE_module_sequencage.id_module_sequencage\r\nJOIN CLASS_session_to_be_affected ON CLASS_session_to_be_affected.id_module_sequence = MAQUETTE_module_sequence.id_module_sequence\r\nJOIN LNM_groupe ON LNM_groupe.id_groupe = CLASS_session_to_be_affected.id_groupe\r\nJOIN CLASS_session_to_be_affected_as_enseignant ON CLASS_session_to_be_affected_as_enseignant.id_seance_to_be_affected = CLASS_session_to_be_affected.id_seance_to_be_affected\r\nJOIN LNM_enseignant ON LNM_enseignant.id_enseignant = CLASS_session_to_be_affected_as_enseignant.id_enseignant\r\nJOIN LNM_seanceType ON LNM_seanceType.id_seance_type = MAQUETTE_module_sequencage.id_seance_type\r\nWHERE 1\r\nGROUP BY LNM_enseignant.prenom, LNM_enseignant.nom, MAQUETTE_module.code_module \r\nORDER BY `LNM_enseignant`.`nom` DESC;'),
(19, 20, '3 Intervention par groupe', 'Enseignant', 'SELECT LNM_enseignant.prenom, LNM_enseignant.nom, MAQUETTE_module.code_module, LNM_groupe.nom_groupe,\r\nSUM(case when LNM_seanceType.type = \"CM\" THEN MAQUETTE_module_sequencage.duree_h END) AS \"CM\",\r\nSUM(case when LNM_seanceType.type = \"TD\" THEN MAQUETTE_module_sequencage.duree_h END) AS \"TD\",\r\nSUM(case when LNM_seanceType.type = \"TP\" THEN MAQUETTE_module_sequencage.duree_h END) AS \"TP\"\r\nFROM `MAQUETTE_module` \r\nJOIN MAQUETTE_module_sequencage ON MAQUETTE_module_sequencage.id_module = MAQUETTE_module.id_module\r\nJOIN MAQUETTE_module_sequence ON MAQUETTE_module_sequence.id_module_sequencage = MAQUETTE_module_sequencage.id_module_sequencage\r\nJOIN CLASS_session_to_be_affected ON CLASS_session_to_be_affected.id_module_sequence = MAQUETTE_module_sequence.id_module_sequence\r\nJOIN LNM_groupe ON LNM_groupe.id_groupe = CLASS_session_to_be_affected.id_groupe\r\nJOIN CLASS_session_to_be_affected_as_enseignant ON CLASS_session_to_be_affected_as_enseignant.id_seance_to_be_affected = CLASS_session_to_be_affected.id_seance_to_be_affected\r\nJOIN LNM_enseignant ON LNM_enseignant.id_enseignant = CLASS_session_to_be_affected_as_enseignant.id_enseignant\r\nJOIN LNM_seanceType ON LNM_seanceType.id_seance_type = MAQUETTE_module_sequencage.id_seance_type\r\nWHERE 1\r\nGROUP BY LNM_enseignant.prenom, LNM_enseignant.nom, MAQUETTE_module.code_module,  LNM_groupe.nom_groupe\r\nORDER BY LNM_groupe.nom_groupe, `LNM_enseignant`.`nom`;'),
(20, 10, 'Erreur de séquencage', 'Check', 'SELECT \r\n    `MAQUETTE_module`.`code_module`, \r\n    IFNULL(`hCM`,0) + IFNULL(`hTD`,0) + IFNULL(`hTP`,0) + IFNULL(`hTPTD`,0) + IFNULL(`hPROJ`,0) AS `hMCCC`, \r\n    `hCequenced`, \r\n    IFNULL(`hCM`,0) + IFNULL(`hTD`,0) + IFNULL(`hTP`,0) + IFNULL(`hTPTD`,0) + IFNULL(`hPROJ`,0) - `hCequenced` AS `Reste à planifier`\r\nFROM `MAQUETTE_module`\r\nJOIN `LNM_semestre` ON `LNM_semestre`.`id_semestre` = `MAQUETTE_module`.`id_semestre`\r\n  JOIN `MAQUETTE_module_as_learning_unit` ON `MAQUETTE_module_as_learning_unit`.`id_module` = `MAQUETTE_module`.`id_module`\r\n  JOIN `MAQUETTE_learning_unit` ON `MAQUETTE_learning_unit`.`id_learning_unit` = `MAQUETTE_module_as_learning_unit`.`id_learning_unit`\r\n  JOIN `LNM_promo` ON `MAQUETTE_learning_unit`.`id_promo` = `LNM_promo`.`id_promo`\r\n  JOIN `LNM_statut` ON `LNM_statut`.`id_statut` = `LNM_promo`.`id_statut`\r\n  JOIN `LNM_filiere` \r\n       ON `LNM_filiere`.`id_filiere` = `LNM_promo`.`id_filiere`\r\n  JOIN `MAQUETTE_discipline`\r\n       ON `MAQUETTE_discipline`.`id_discipline` = `MAQUETTE_module`.`id_discipline`\r\nJOIN (\r\n    SELECT `code_module`, SUM(`duree_h`) as hCequenced\r\n    FROM `MAQUETTE_module_sequencage` \r\n    JOIN `MAQUETTE_module_sequence` ON `MAQUETTE_module_sequence`.id_module_sequencage = `MAQUETTE_module_sequencage`.id_module_sequencage\r\n    JOIN `MAQUETTE_module` ON `MAQUETTE_module`.`id_module` = `MAQUETTE_module_sequencage`.`id_module`\r\n    GROUP BY `code_module`) sequenced ON  sequenced.`code_module` = `MAQUETTE_module`.`code_module`\r\nWHERE 1;'),
(21, 20, '1 Intervention par CMTDTP', 'Enseignant', 'SELECT LNM_enseignant.prenom, LNM_enseignant.nom, \r\nSUM(case when LNM_seanceType.type = \"CM\" THEN MAQUETTE_module_sequencage.duree_h END) AS \"CM\",\r\nSUM(case when LNM_seanceType.type = \"TD\" THEN MAQUETTE_module_sequencage.duree_h END) AS \"TD\",\r\nSUM(case when LNM_seanceType.type = \"TP\" THEN MAQUETTE_module_sequencage.duree_h END) AS \"TP\"\r\nFROM `MAQUETTE_module` \r\nJOIN MAQUETTE_module_sequencage ON MAQUETTE_module_sequencage.id_module = MAQUETTE_module.id_module\r\nJOIN MAQUETTE_module_sequence ON MAQUETTE_module_sequence.id_module_sequencage = MAQUETTE_module_sequencage.id_module_sequencage\r\nJOIN CLASS_session_to_be_affected ON CLASS_session_to_be_affected.id_module_sequence = MAQUETTE_module_sequence.id_module_sequence\r\nJOIN LNM_groupe ON LNM_groupe.id_groupe = CLASS_session_to_be_affected.id_groupe\r\nJOIN CLASS_session_to_be_affected_as_enseignant ON CLASS_session_to_be_affected_as_enseignant.id_seance_to_be_affected = CLASS_session_to_be_affected.id_seance_to_be_affected\r\nJOIN LNM_enseignant ON LNM_enseignant.id_enseignant = CLASS_session_to_be_affected_as_enseignant.id_enseignant\r\nJOIN LNM_seanceType ON LNM_seanceType.id_seance_type = MAQUETTE_module_sequencage.id_seance_type\r\nWHERE 1\r\nGROUP BY LNM_enseignant.prenom, LNM_enseignant.nom\r\nORDER BY `LNM_enseignant`.`nom` DESC;'),
(22, 20, '0 Intervention : Charge', 'Enseignant', 'SELECT LNM_enseignant.prenom, LNM_enseignant.nom, \r\nSUM(\r\nCASE \r\nWHEN LNM_seanceType.type = \"CM\" THEN MAQUETTE_module_sequencage.duree_h \r\nWHEN LNM_seanceType.type = \"TD\" THEN MAQUETTE_module_sequencage.duree_h\r\nWHEN LNM_seanceType.type = \"TP\" THEN MAQUETTE_module_sequencage.duree_h \r\nEND) AS \"Charge\"\r\nFROM `MAQUETTE_module` \r\nJOIN MAQUETTE_module_sequencage ON MAQUETTE_module_sequencage.id_module = MAQUETTE_module.id_module\r\nJOIN MAQUETTE_module_sequence ON MAQUETTE_module_sequence.id_module_sequencage = MAQUETTE_module_sequencage.id_module_sequencage\r\nJOIN CLASS_session_to_be_affected ON CLASS_session_to_be_affected.id_module_sequence = MAQUETTE_module_sequence.id_module_sequence\r\nJOIN LNM_groupe ON LNM_groupe.id_groupe = CLASS_session_to_be_affected.id_groupe\r\nJOIN CLASS_session_to_be_affected_as_enseignant ON CLASS_session_to_be_affected_as_enseignant.id_seance_to_be_affected = CLASS_session_to_be_affected.id_seance_to_be_affected\r\nJOIN LNM_enseignant ON LNM_enseignant.id_enseignant = CLASS_session_to_be_affected_as_enseignant.id_enseignant\r\nJOIN LNM_seanceType ON LNM_seanceType.id_seance_type = MAQUETTE_module_sequencage.id_seance_type\r\nWHERE 1\r\nGROUP BY LNM_enseignant.prenom, LNM_enseignant.nom\r\nORDER BY `LNM_enseignant`.`nom` DESC;'),
(23, 10, 'Enseignant sans cours', 'Check', 'SELECT `LNM_enseignant`.* \r\nFROM `LNM_enseignant` \r\nLEFT JOIN CLASS_session_to_be_affected_as_enseignant ON CLASS_session_to_be_affected_as_enseignant.id_enseignant = LNM_enseignant.id_enseignant\r\nWHERE CLASS_session_to_be_affected_as_enseignant.id_enseignant IS NUll;'),
(24, 10, 'Erreur de nombre de séquences', 'Check', 'SELECT MAQUETTE_module.code_module, LNM_seanceType.type, LNM_groupe_type.groupe_type, max(MAQUETTE_module_sequencage.nombre) - count(`MAQUETTE_module_sequence`.`numero_ordre`) \r\nFROM `MAQUETTE_module_sequence` \r\nJOIN MAQUETTE_module_sequencage ON MAQUETTE_module_sequencage.id_module_sequencage = MAQUETTE_module_sequence.id_module_sequencage\r\nJOIN MAQUETTE_module ON MAQUETTE_module.id_module = MAQUETTE_module_sequencage.id_module\r\nJOIN LNM_seanceType ON LNM_seanceType.id_seance_type = MAQUETTE_module_sequencage.id_seance_type\r\nJOIN LNM_groupe_type ON LNM_groupe_type.id_groupe_type = MAQUETTE_module_sequencage.id_groupe_type\r\nWHERE 1\r\nGROUP BY MAQUETTE_module.code_module, LNM_seanceType.type, LNM_groupe_type.groupe_type  \r\nHAVING max(MAQUETTE_module_sequencage.nombre) - count(`MAQUETTE_module_sequence`.`numero_ordre`) != 0;');
INSERT INTO `VIEW_parameters_of_views` (`id_parameters_of_views`, `userId`, `sessionId`, `id_semestre`, `id_module`, `id_discipline`, `id_enseignant`, `id_filiere`, `id_statut`) VALUES
(4, 6, 'ccdc72062628625b1bf2f51be2fc2429', NULL, NULL, NULL, 6, NULL, NULL);
INSERT INTO `VIEW_updatable` (`id_updatable`, `sortIndex`, `table_name`, `table_name_displayed`, `group_of_views`, `allow_insert`, `allow_update`, `request`) VALUES
(1, 1, 'MAQUETTE_module', 'Modules', 'Module', 1, 1, 'SELECT DISTINCT MAQUETTE_module.* \r\nFROM MAQUETTE_module\r\nJOIN MAQUETTE_discipline ON MAQUETTE_discipline.id_discipline=MAQUETTE_module.id_discipline\r\nJOIN LNM_semestre ON LNM_semestre.id_semestre=MAQUETTE_module.id_semestre\r\n\r\n  JOIN MAQUETTE_module_as_learning_unit ON MAQUETTE_module_as_learning_unit.id_module = MAQUETTE_module.id_module\r\n  JOIN MAQUETTE_learning_unit ON MAQUETTE_learning_unit.id_learning_unit = MAQUETTE_module_as_learning_unit.id_learning_unit\r\n  JOIN LNM_promo ON MAQUETTE_learning_unit.id_promo = LNM_promo.id_promo\r\n\r\nJOIN LNM_statut ON LNM_statut.id_statut = LNM_promo.id_statut\r\nJOIN LNM_filiere ON LNM_filiere.id_filiere = LNM_promo.id_filiere\r\nWHERE 1;'),
(2, 2, 'MAQUETTE_module_sequencage', 'Séquencages', 'Module', 1, 1, 'SELECT DISTINCT `MAQUETTE_module_sequencage`.* \r\nFROM `MAQUETTE_module_sequencage` \r\nJOIN MAQUETTE_module ON MAQUETTE_module.id_module=MAQUETTE_module_sequencage.id_module\r\nJOIN MAQUETTE_discipline ON MAQUETTE_discipline.id_discipline=MAQUETTE_module.id_discipline\r\nJOIN LNM_semestre ON LNM_semestre.id_semestre=MAQUETTE_module.id_semestre\r\n\r\n  JOIN MAQUETTE_module_as_learning_unit ON MAQUETTE_module_as_learning_unit.id_module = MAQUETTE_module.id_module\r\n  JOIN MAQUETTE_learning_unit ON MAQUETTE_learning_unit.id_learning_unit = MAQUETTE_module_as_learning_unit.id_learning_unit\r\n  JOIN LNM_promo ON MAQUETTE_learning_unit.id_promo = LNM_promo.id_promo\r\n\r\nJOIN LNM_statut ON LNM_statut.id_statut = LNM_promo.id_statut\r\nJOIN LNM_filiere ON LNM_filiere.id_filiere = LNM_promo.id_filiere\r\nWHERE 1;'),
(3, 3, 'MAQUETTE_dependance_sequence', 'Dépendances séquences', 'Module', 1, 1, 'SELECT `MAQUETTE_dependance_sequence`.* \r\nFROM `MAQUETTE_dependance_sequence` \r\nJOIN MAQUETTE_module_sequence ON MAQUETTE_module_sequence.id_module_sequence = MAQUETTE_dependance_sequence.id_sequence_prev \r\n\r\nJOIN MAQUETTE_module_sequencage ON MAQUETTE_module_sequencage.id_module_sequencage = MAQUETTE_module_sequence.id_module_sequencage\r\n\r\nJOIN MAQUETTE_module ON MAQUETTE_module.id_module=MAQUETTE_module_sequencage.id_module \r\nJOIN MAQUETTE_discipline ON MAQUETTE_discipline.id_discipline=MAQUETTE_module.id_discipline \r\nJOIN LNM_semestre ON LNM_semestre.id_semestre=MAQUETTE_module.id_semestre \r\nJOIN MAQUETTE_module_as_learning_unit ON MAQUETTE_module_as_learning_unit.id_module = MAQUETTE_module.id_module \r\nJOIN MAQUETTE_learning_unit ON MAQUETTE_learning_unit.id_learning_unit = MAQUETTE_module_as_learning_unit.id_learning_unit \r\nJOIN LNM_promo ON MAQUETTE_learning_unit.id_promo = LNM_promo.id_promo \r\nJOIN LNM_statut ON LNM_statut.id_statut = LNM_promo.id_statut \r\nJOIN LNM_filiere ON LNM_filiere.id_filiere = LNM_promo.id_filiere \r\nWHERE 1;'),
(4, 4, 'MAQUETTE_module_as_learning_unit', 'Afectation Module UE', 'Module', 1, 1, 'SELECT MAQUETTE_module_as_learning_unit.* \r\nFROM MAQUETTE_module_as_learning_unit\r\nJOIN MAQUETTE_module ON MAQUETTE_module.id_module = MAQUETTE_module_as_learning_unit.id_module\r\nJOIN MAQUETTE_discipline ON MAQUETTE_discipline.id_discipline = MAQUETTE_module.id_discipline\r\nJOIN LNM_semestre ON LNM_semestre.id_semestre = MAQUETTE_module.id_semestre\r\n JOIN MAQUETTE_learning_unit ON MAQUETTE_learning_unit.id_learning_unit = MAQUETTE_module_as_learning_unit.id_learning_unit\r\nJOIN LNM_promo ON MAQUETTE_learning_unit.id_promo = LNM_promo.id_promo\r\nJOIN LNM_statut ON LNM_statut.id_statut = LNM_promo.id_statut\r\nJOIN LNM_filiere ON LNM_filiere.id_filiere = LNM_promo.id_filiere\r\nWHERE 1;'),
(5, 5, 'CLASS_session_type_to_be_affected_as_enseignant', 'Affectation types séances', 'Module', 0, 1, 'SELECT `CLASS_session_type_to_be_affected_as_enseignant`.* \r\nFROM `CLASS_session_type_to_be_affected_as_enseignant`\r\n\r\nJOIN CLASS_session_type_to_be_affected ON CLASS_session_type_to_be_affected.id_type_seance_to_be_affected = CLASS_session_type_to_be_affected_as_enseignant.id_type_seance_to_be_affected\r\nJOIN LNM_groupe ON LNM_groupe.id_groupe = CLASS_session_type_to_be_affected.id_groupe\r\nJOIN MAQUETTE_module_sequencage ON MAQUETTE_module_sequencage.id_module_sequencage = CLASS_session_type_to_be_affected.id_module_sequencage\r\n\r\nJOIN MAQUETTE_module ON MAQUETTE_module.id_module = MAQUETTE_module_sequencage.id_module\r\nJOIN MAQUETTE_discipline ON MAQUETTE_discipline.id_discipline = MAQUETTE_module.id_discipline\r\nJOIN LNM_semestre ON LNM_semestre.id_semestre = MAQUETTE_module.id_semestre\r\nJOIN MAQUETTE_module_as_learning_unit ON MAQUETTE_module_as_learning_unit.id_module = MAQUETTE_module.id_module\r\nJOIN MAQUETTE_learning_unit ON MAQUETTE_learning_unit.id_learning_unit = MAQUETTE_module_as_learning_unit.id_learning_unit\r\nJOIN LNM_promo ON LNM_promo.id_promo = MAQUETTE_learning_unit.id_promo AND LNM_groupe.id_promo = LNM_promo.id_promo\r\n\r\nJOIN LNM_statut ON LNM_statut.id_statut = LNM_promo.id_statut\r\nJOIN LNM_filiere ON LNM_filiere.id_filiere = LNM_promo.id_filiere\r\nWHERE 1;'),
(6, 6, 'CLASS_session_to_be_affected_as_enseignant', 'Affectation séances', 'Module', 0, 1, 'SELECT `CLASS_session_to_be_affected_as_enseignant`.* \r\nFROM `CLASS_session_to_be_affected_as_enseignant`\r\n\r\nJOIN CLASS_session_to_be_affected ON CLASS_session_to_be_affected.id_seance_to_be_affected = `CLASS_session_to_be_affected_as_enseignant`.`id_seance_to_be_affected`\r\nJOIN LNM_groupe ON LNM_groupe.id_groupe = CLASS_session_to_be_affected.id_groupe\r\nJOIN MAQUETTE_module_sequence ON MAQUETTE_module_sequence.id_module_sequence = CLASS_session_to_be_affected.id_module_sequence\r\nJOIN MAQUETTE_module_sequencage ON MAQUETTE_module_sequencage.id_module_sequencage = MAQUETTE_module_sequence.id_module_sequencage\r\n\r\nJOIN MAQUETTE_module ON MAQUETTE_module.id_module = MAQUETTE_module_sequencage.id_module\r\nJOIN MAQUETTE_discipline ON MAQUETTE_discipline.id_discipline = MAQUETTE_module.id_discipline\r\nJOIN LNM_semestre ON LNM_semestre.id_semestre = MAQUETTE_module.id_semestre\r\nJOIN MAQUETTE_module_as_learning_unit ON MAQUETTE_module_as_learning_unit.id_module = MAQUETTE_module.id_module\r\nJOIN MAQUETTE_learning_unit ON MAQUETTE_learning_unit.id_learning_unit = MAQUETTE_module_as_learning_unit.id_learning_unit\r\nJOIN LNM_promo ON LNM_promo.id_promo = MAQUETTE_learning_unit.id_promo AND LNM_groupe.id_promo = LNM_promo.id_promo\r\n\r\nJOIN LNM_statut ON LNM_statut.id_statut = LNM_promo.id_statut\r\nJOIN LNM_filiere ON LNM_filiere.id_filiere = LNM_promo.id_filiere\r\nWHERE 1;\r\n'),
(7, 1, 'APC_apprentissage_critique_as_module', 'Apprentissage Critique 2 Module', 'APC', 1, 1, 'SELECT DISTINCT APC_apprentissage_critique_as_module.* \r\nFROM APC_apprentissage_critique_as_module\r\nJOIN MAQUETTE_module ON APC_apprentissage_critique_as_module.id_module = MAQUETTE_module.id_module\r\nJOIN APC_apprentissage_critique ON APC_apprentissage_critique_as_module.id_apprentissage_critique = APC_apprentissage_critique.id_apprentissage_critique\r\nJOIN APC_niveau ON APC_apprentissage_critique.id_niveau = APC_niveau.id_niveau\r\nJOIN APC_competence ON APC_niveau.id_competence = APC_competence.id_competence\r\nJOIN APC_competence_as_filiere_as_statut ON APC_competence.id_competence = APC_competence_as_filiere_as_statut.id_competence\r\n\r\n\r\n  JOIN MAQUETTE_module_as_learning_unit ON MAQUETTE_module_as_learning_unit.id_module = MAQUETTE_module.id_module\r\n  JOIN MAQUETTE_learning_unit ON MAQUETTE_learning_unit.id_learning_unit = MAQUETTE_module_as_learning_unit.id_learning_unit\r\n  JOIN LNM_promo ON MAQUETTE_learning_unit.id_promo = LNM_promo.id_promo\r\n\r\nJOIN LNM_statut ON LNM_statut.id_statut = LNM_promo.id_statut AND LNM_statut.id_statut = APC_competence_as_filiere_as_statut.id_status\r\nJOIN LNM_filiere ON LNM_filiere.id_filiere = LNM_promo.id_filiere AND LNM_filiere.id_filiere = APC_competence_as_filiere_as_statut.is_filiere\r\nWHERE 1;');
